text:
@regran_ed from @mgtow_man -  looks like mgtow finally made it to mainstream media. why #cnn had to be the network to pick up this story doesn’t make me happy, nor does the mainstream exposure of this philosophy. keeping this underground is part of the #fightclub allure of it. having the world become aware just puts a huge target on our backs. the story line was a sob-story, however if lisa ling thinks that’s what we want then i think she’s off-base. i don’t believe we are looking for a woman’s sympathy. best case scenario it wakes up some men who are drowning in blue pills and grows the movement, worst case it makes the system that is set up to hurt men even more vigilant in keeping us on the plantation. if anyone believes the injustices us men have to deal with daily is just a coincidence, believe me everything is done intentionally. this is social engineering. there is nothing “fair” about the gynocentric system we live under. it’s made to exalt women and keep men down. to women, gender equality means -> gender superiority. this truly is a gender war as big john, who i respect, mentioned. women have relentlessly pushed and pushed and us men cannot fight back, which is why we are ghosting society and going our own way. the 42 minute story could have done a better job explaining the injustices of #metoo false accusations that ruin men’s lives, the unfairness of dating, the fact that women aren’t women anymore, women’s infidelity, female monkey branching, their entitled attitudes, social media attention whoring, men being discouraged to pursue higher education because college campuses have become increasingly anti-male, the destruction of the family unit because of government assistance for single mothers.. etc etc. there are 1 million issues beyond just divorce, child support and alimony. .
.
thanks for all #mgtow for your support. i love this community for many reasons but mainly because it has been a way for us to share very critical ideas with each other. you can find your voice here and we have each other’s backs. if i never found other men going through the same things i have i would have believed i was the only one. #brotherhood #redpill

